	["My career as a TV fortune teller was going well. Some time ago, I took out a loan to start my own business, which turned out to be a scam, of course. I went to the turf accountant and bet on RKS Huwdu winning. Those failures of a human decided to lose, and I ended up with a payday loan with 69% interest! The deadline for the first loan installment is approaching. I don't want the bailiff to seize my house. Try asking Andrew the Moustachizzle about my problem. They always manage to avoid the law and responsibility."] = "Moja kariera telewizyjnego wrozbity szla najbardziej pomyslnie. Jakis czas temu wzialem kredyt na otworzenie wlasnej dzialanosci, co oczywiscie bylo sciema. Poszedlem do bukmachera i obstawilem wygrana rks huwdu. Ci nieudacznicy postanowili przegrac, a ja zostalem z chwilowka oprocentowana na 69%! Termin splaty pierwszej raty kredytu zaraz uplywa. Nie chce zeby komornik mi zajal dom. Sprobuj zapytac Andrzeja Wasacza o moj problem, oni zawsze jakos unikaja prawa i odpowiedzialnosci.",
	["Thanks for your help. Now I'll be able to set up my office properly. Please take my mining helmet as a reward. As for the costs, I didn't expect such a high amount. I only have 70 platinum with me. I'll try to cover the rest in the future."] = "Dzieki za pomoc, teraz bede mogl zrobic urzad w chuja. Prosze wez moj helm gorniczy jako nagrode. Jezeli chodzi o koszty, to nie spodziewalem sie tak wysokiej kwoty. Mam przy sobie tylko 70 platynek. Reszte postaram sie pokryc w przyszlosci.",
	["Don't you have a new document for me yet? I'll wait then."] = "Nie masz jeszcze dla mnie nowego dokumentu? W takim razie bede czekac.",
	["You still need to help me with one more thing. I accidentally burned my cover, and the officials will seize my house soon. For financial scams, evading the authorities and other frauds, I'll get at least 15 years. I'm too old for that. I won't even survive that long. I thought about escaping from this continent. Somewhere in the desert, deep underground, I parked my steamboat. It was a long time ago, so I don't remember where the entrance to the cave is where I keep the steam engine. All I remember is that the entrance is boarded up. Just find that place and come back to me to mark it on the map."] = "Musisz mi pomoc jeszcze z jedna rzecza. Mianowicie spalilem swoja przykrywke i zaraz urzednicy zajma mi dom. Za machlojki finansowe, ukrywanie sie przed psami i inne oszustwa dostane co najmniej 15 lat. Jestem na to za stary. Ja nawet nie tyle nie dozyje. Wpadlem na pomysl, zeby uciec z tego kontynentu. Gdzies na pustyni, w glebokich podziemiach zaparkowalem swoj parostatek. To bylo dawno temu, wiec nie pamietam gdzie jest wejscie do jaskini, w ktorej trzymam parowoz. Jedyne co mi swita, to ze {wejscie} jest zabite deskami. Wystarczy ze znajdziesz to miejsce, i wrocisz do mnie, aby mi je wskazac na mapie.",
	["Come to think of it, I might have encountered some gargoyles while exploring around the cave."] = "Jak tak pomyslalem, to mozliwe, ze gdy przemierzalem okolice jaskini, to napotkalem jakies gargoyle.",
	["Are you sure that's the place? All right, here are the keys to my mole. I don't remember where I parked it, but actually, any mole will do. One more thing: I heard that my travel companion, Gandalf, is still alive. We used to steal from a certain library where we found a prophecy about the resurrection of the Crypt King. If that moment ever comes, I think Gandalf will count on the help of the bravest warriors like you. If you want to befriend him, it's worth remembering this secret passphrase: {aside from that people}. Meanwhile, I'm heading out of here. Goodbye."] = "Jestes pewien ze to wlasnie tam? No dobra, oto klucze do mojego kreta. Nie wiem gdzie go zaparkowalem, ale wlasciwie to wystarczy, ze znajdziesz dowolnego innego kreta.\n\nJeszcze jedno: dowiedzialem sie, ze moj wspoltowarzysz podrozy - Gandalf - zyje. Niegdys rabowalismy zbiory pewnej biblioteki, w ktorej znalezlismy przepowiednie, ktora mowila o ponownym powstaniu krola krypty. Jezeli ten moment kiedys nastapi, to mysle gandalf bedzie liczyc na pomoc najdzielniejszych wojownikow, takich jak ty. Jezeli bedziesz chcial sie z nim zaprzyjaznic to warto, zebys zapamietal to tajne haslo: {oprocz tego ludzie}.\n\nTymczasem ja sie stad zawijam, elo.",
	["Found, not stolen. But due to our acquaintance, I can return what I took from Gandalf. Here's his camo backpack that I couldn't open. I won't lie, I'd like to know what's inside. Besides that, I have some stuff from WotE and this strange bag."] = "Znalezione nie kradzione. No ale ze wzgledu na nasza znajomosc moge oddac Ci to co zabralem Gandalfowi. Masz tu jego plecak moro, ktorego nie moglem otworzyc. Nie bede sciemniac, chcialbym wiedziec co w nim jest. Oprocz tego mam jeszcze jakis syf z WotE oraz ten dziwny worek.",
	["In this bag i kept an item from the WotE quest. I completed it on the *REDACTED* server. Do you remember was item it was?"] = "W tym worku trzymalem item z WotE, ktorego robilem na... no tym serwerze, gdzie gm nie trafial banem. Pamietasz jak nazywal sie ten item?",
	["Right, it was the Elite Draken Helmet. Here's your reward."] = "Racja, to byl Elite Draken Helmet. Prosze, oto twoja nagroda",
	["Right, it was the Royal Draken Mail. Here's your reward."] = "Racja, to byl Royal Draken Mail. Prosze, oto twoja nagroda",
